    public static void GetRewardByNum(int Day, ref string ItemDef, ref int ItemCount)
    {
        //Parse Daily Rewards
        var Reward = JsonDocument.Parse(DailyRewardsJSONString).RootElement.GetProperty("Rows").GetProperty(Day.ToString());

        ItemDef = Reward.GetProperty("ItemDefinition").GetProperty("AssetPathName").ToString();
        ItemCount = Reward.GetProperty("ItemCount").GetInt32();
    }

